import React from "react";
import logo from "./mintbean.png";
import styles from "./styles/mystyle.module.css";
var tinycolor = require("tinycolor2");

const appStyle = {
  fontFamily: "sans-serif",
  textAlign: "center",
  margin: "6rem 0",
};

function App() {
  return <div className={appStyle}>Hello World</div>;
}

export default App;
